VALUES ('8411462007421', 'Sandwich de helado de soja. Pack de 6', 'Agua, galleta al cacao 29% (harina de _trigo_ (_gluten_), azúcar, grasa vegetal de palma, cacao, dextrosa, fructosa, emulgente: lecitina de _soja_ (E-322), sal, gasificantes: bicarbonato sódico(E-500ii) y bicarbonato amónico (E-503ii), agente de tratamiento de la harina: l-cisteína (E-920) y aromas), azúcar, grasa vegetal de coco, jarabe de glucosa-fructosa, proteína aislada de _soja_, agente de carga: polidextrosa (E-1200), emulgente: mono y diglicéridos de ácidos grasos (E-471), estabiltzantes: goma guar (E-412), carragenanos (E-407) y goma garrofín (E-410); colorantes: annato (E-160b) y curcumina (E-100); aromas y sal. ', 'https://static.openfoodfacts.org/images/products/841/146/200/7421/front_es.7.400.jpg', '14.6', '11', '31.8', '30.2', '', '3.1', '0.12', '0.047244094488189', '', '0');

